      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 NOT IN ( - - CAST ( - - CAST ( - col0 AS INTEGER ) AS INTEGER ), + 66 - - col2, ( - 41 ) );
  - name: tab2

outputs:
  - name: q3012.out
    data: |
      46	51	23
      64	77	40
      75	67	58
